export default class Table extends React.Component {
  render() {
    return (
      <table class="table">
        <thead>
          <tr>
            {Object.keys(PROJECTS[0]).map(head => {
              if (head ==="link") return null;
              return <th className='T' scope="col">{head}</th>;
            })}
          </tr>
        </thead>
        <tbody>
          {PROJECTS.map(object => {
            const link = object.link;
            return (
              <tr>
                {Object.entries(object).map(( [ key,value ] ) => {
                    if (key === "link") return null;
                    if (key ==="Title") return <td className='T'><a className="whiteTxt plainLink" target="_blank" href={`${link}`}>{value}</a></td>;
                    return <td className='T'>{value}</td>;
                  }
                )}
              </tr>
            );
          })}
        </tbody>
      </table>
    );
  }
}
